import React from 'react';

const Practice = ({ content }) => {
    return (
        <div>
            <h2>Практические задания</h2>
            {content.map((item, index) => (
                <div key={index}>
                    <p>{item.task}</p>
                    <p><em>{item.example}</em></p>
                </div>
            ))}
        </div>
    );
};

export default Practice;
